(1,'2021-03-10 05:35:49','Атырауские школы провалили переход на комбинированное обучение','Атырауские школы оказались не готовы к наплыву учеников после ослабления карантинных ограничений. С утра во многих школах областного центра наблюдалось настоящее столпотворение. Родители возмущались отсутствием санитарных условий, ученики не могли найти свои классы, сообщает корреспондент Tengrinews.kz.<br />\r\nСогласно новому постановлению главного санитарного врача Атырауской области ученики с 1-го по 5-й классы с этой недели перешли на комбинированный формат обучения. Количество учащихся в классах увеличили с 15 до 25. Изменилось как их количество, так и время обучения. Многие ученики пошли в школу впервые с начала карантина.<br />\r\nВ первой половине дня в областном акимате провели совещание. Заместитель акима области Бакытгуль Хаменова выступила с резкой критикой в адрес руководителей учебных заведений.<br />\r\n\"У нас нет права провоцировать социальное недовольство среди родителей. Поручаю данный вопрос держать на особом контроле. По видео, которое распространяется в социальных сетях, видно, что некоторые школы оказались не готовыми. И здесь вина лежит на директорах школ. Вы с сентября прошлого года были обязаны привести свои учебные заведение в полное соответствие с санитарными требованиями. И неважно, когда вышло постановление. Если бы все было готово, такой ситуации не возникло бы. Да, есть объективные причины, но школы должны быть готовы\", - обратилась к директорам школ Хаменова.<br />\r\nЗаместитель акима области Бакытгуль Хаменова<br />\r\nВ итоге было принято решение оставить онлайн-обучение для тех учеников, кто еще не готов к резкому переходу на традиционный формат. \"Есть родители, которые не могут привыкнуть к новым условиям обучения. У кого-то занятость, другие хотят обучать детей дома в онлайн-режиме. Но самое главное - это вопросы безопасности. А потому до окончания третьей четверти мы решили оставить смешанный формат бучения. Для тех, кто желает учиться офлайн, мы увеличили численность классов до 25 учеников, те, кто желает учиться онлайн, продолжат учебу в прежнем формате\", - добавила Хаменова.<br />\r\nНа сегодняшний день порядка 61 тысячи учеников начальных классов в Атырауской области обучаются в офлайн-формате. С начала учебного года коронавирусом заразились более 200 школьников. 33 из них посещали дежурные классы.<br />\r\n',,'image/jpeg'),
(2,'2021-03-11 05:37:40','16 школ построят в Нур-Султане в 2021 году','В Нур-Султане в 2021 году построят 16 школ. Об этом сообщил аким столицы Алтай Кульгинов, передает Tengrinews.kz.<br />\r\nКак написал Кульгинов на своей странице в Instagram, во время утреннего объезда он ознакомился с ходом строительства ряда учебных заведений.<br />\r\n\"К примеру, школа, расположенная в районе Есиль (пересечение проспекта Ұлы Дала и улицы № 39), в две смены позволит создать 2400 ученических мест. Столько же мест будет создано в учебном заведении в районе Алматы (пересечение улиц Каныша Сатпаева и Жумекена Нажимеденова)\", - отметил аким.<br />\r\nАким также сообщил, что поручил мобилизовать технику и людей: \"Необходимо будет оснастить учебные заведения всем необходимым оборудованием, продумать подъездные пути к школам, а также уделять особое внимание благоустройству и озеленению территорий школ. По второй школе также поручил решить вопрос с подключением к инженерным сетям\".',,'image/jpeg'),
(3,'2021-03-16 05:39:10','Министр рассказал о ситуации с коронавирусом среди школьников','Министр здравоохранения Алексей Цой рассказал, как изменилась ситуация по коронавирусу среди школьников после открытия школ, передает корреспондент Tengrinews.kz.<br />\r\n\"С учетом постепенного запуска обучения в офлайн-режиме мы проводим ежедневный мониторинг заболеваемости школьников. Продолжается регистрация случаев среди школьников. Общее количество заболевших по республике не превышает 0,2 процента учащихся\", - сообщил Цой на заседании правительства. <br />\r\nПо словам министра, в настоящее время карантинные меры применяются дифференцированно, с учетом заболеваемости в регионах и в отдельной взятой школе.<br />\r\n\"В целях подготовки объектов образования к обучению в офлайн-режиме проведено 3266 проверок на предмет соблюдения требований режима карантина, в ходе которых выявлены нарушения в 282 школах, или 8,6 процента. В настоящее время все выявленные нарушения устранены\", - сказал Цой. <br />\r\nГлава Минздрава отметил, что в связи с увеличением числа обучающихся в офлайн-режиме акимам территорий необходимо обеспечить постоянный контроль за соблюдением санэпидтребований и исполнением основных мер профилактики КВИ в организациях образования, таких как проведение утреннего фильтра, соблюдение масочного режима персоналом, проведение влажной уборки и дезинфекции помещений и других.',,'image/jpeg'),
(4,'2021-03-19 05:40:44','Ученики школы IQanat посетили \"ПавлодарЭнерго\" по приглашению Сергея Кана','Меценаты Сергей Кан и Андрей Лаврентьев организовали экскурсии на крупнейшие производства страны.<br />\r\nВ приоритете попечителей благотворительного фонда IQanat – помочь сельским детям с выбором профессионального призвания. Бизнесмены организовывают для школьников выпускных классов поездки на крупнейшие стратегические производственные предприятия страны. Ребята уже побывали на объектах \"ПавлодарЭнерго\", \"СарыаркаАвтоПрома\" по личным приглашениям Сергея Кана и Андрея Лаврентьева.<br />\r\n60 попечителей фонда IQanat, вложившие только за текущий год 1 миллион долларов в развитие человеческого капитала при поддержке фонда, намерены в корне улучшить ситуацию с образованием и всесторонним развитием детей из аулов. Меценаты, в числе которых Сергей Кан, Андрей Лаврентьев, Арманжан Байтасов, Тимур Турлов, Берик Каниев, Рамиль Мухоряпов, Багдат Мусин, собственным примером мотивируют школьников менять свою жизнь, выбирать ту профессию, которая по-настоящему соответствует их жизненному призванию. Опираясь на свой жизненный и бизнес-опыт, попечители фонда организовывают экскурсии для учеников по регионам страны и крупным предприятиям. Такие поездки расширяют кругозор ребят, позволяют познать многогранный мир.',,'image/jpeg');
